import React, { useState } from 'react';
import { BrowserRouter, Routes, Route, Navigate } from 'react-router-dom';
import Header from './Components/Header';
import Index from './Components/Index';
import About from './Components/About';
import Section from './Components/Services';
import Pricing from './Components/Pricing';
import Stats from './Components/Stats';
import Contact from './Components/Contact';
import Portfolio from './Components/Portfolio';
import AddToCart from './Components/AddToCart';
import Signup from './Components/Signup';
import Login from './Components/Login';

// Assume isAuthenticated is a state that indicates whether the user is authenticated or not
// You should replace this with your actual authentication logic
const isAuthenticated = false;

function App() {
  return (
    <BrowserRouter>
      <Routes>
        {/* Route to signup and login only if the user is not authenticated */}
        {!isAuthenticated && (
          <>
            <Route path="/" element={<Signup />} />
            <Route path="/login" element={<Login />} />
          </>
        )}
        {/* Protected routes accessible only when the user is authenticated */}
        {isAuthenticated && (
          <>
            <Route
              path="/dashboard"
              element={
                <>
                  <Header />
                  <Index />
                </>
              }
            />
            <Route
              path="/about"
              element={
                <>
                  <Header />
                  <About />
                </>
              }
            />
            <Route
              path="/section"
              element={
                <>
                  <Header />
                  <Section />
                </>
              }
            />
            <Route
              path="/portfolio"
              element={
                <>
                  <Header />
                  <Portfolio />
                </>
              }
            />
            <Route
              path="/stats"
              element={
                <>
                  <Header />
                  <Stats />
                </>
              }
            />
            <Route
              path="/pricing"
              element={
                <>
                  <Header />
                  <Pricing />
                </>
              }
            />
            <Route
              path="/contact"
              element={
                <>
                  <Header />
                  <Contact />
                </>
              }
            />
            <Route
              path="/addToCart"
              element={
                <>
                  <Header />
                  <AddToCart />
                </>
              }
            />
          </>
        )}
        {/* Redirect to dashboard if authenticated, otherwise to login */}
        <Route
          path="*"
          element={isAuthenticated ? <Navigate to="/dashboard" /> : <Navigate to="/login" />}
        />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
